import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function AdminDashboard() {
  const [chatInput, setChatInput] = useState('');
  const [chatContent, setChatContent] = useState([]);

  const handleChatInputChange = (e) => {
    setChatInput(e.target.value);
  };

  const handleChatSubmit = () => {
    if (chatInput.trim() !== '') {
      const newMessage = `You: ${chatInput}`;
      setChatContent([...chatContent, newMessage]);
      setChatInput('');
    }
  };

  return (
    <div>
      <header>
        <h1>MS in DS Academic Program</h1>
      </header>
      <nav>
        <Link to="/student-admin">Students</Link>
        <Link to="/qa-officer-admin">QAOfficer</Link>
        <Link to="/instructor-admin">Instructor</Link>
        <Link to="/appointment-admin">Appointments</Link>
        <Link to="/">Logout</Link>
      </nav>
      <div className="container">
        <div className="content">
          <div className="dashboard">
            <div className="section">
              <h2>Coordinator</h2>
              <Link to="/reviews"><button>Reviews</button></Link>&nbsp;
              <Link to="/assigned-students"><button>Assigned Students</button></Link>&nbsp;
              <Link to="/handle-course"><button>Handle Course</button></Link>
            </div>
            <div className="section">
              <h2>Student</h2>
              <Link to="/manage-course"><button>Manage Course</button></Link>&nbsp;
              <Link to="/reports"><button>Reports</button></Link>&nbsp;
              <Link to="/performance"><button>Performance</button></Link>&nbsp;
              <Link to="/manage-students"><button>Manage Students</button></Link>
            </div>
            <div className="section">
              <h2>QA Officer</h2>
              <Link to="/assigned-course"><button>Assigned Course</button></Link>&nbsp;
              <Link to="/qa-reports"><button>Reports</button></Link>&nbsp;
              <Link to="/manage-qa-officer"><button>Manage QA Officer</button></Link>&nbsp;
              <Link to="/permissions"><button>Permissions</button></Link>
            </div>
          </div>
        </div>
        <div className="chat-box">
          <div className="close-button">X</div>
          <div className="chat-title">Welcome to the Chatbox!!</div>
          <div className="chat-content">
            {chatContent.map((message, index) => (
              <div key={index}>{message}</div>
            ))}
          </div>
          <input
            type="text"
            className="chat-input"
            placeholder="Type here"
            value={chatInput}
            onChange={handleChatInputChange}
          />
          <button className="chat-button" onClick={handleChatSubmit}>
            SEND
          </button>
        </div>
      </div>
      <footer>
        <p>&copy; Copyright MS in DS Academic Program</p>
      </footer>
    </div>
  );
}

export default AdminDashboard;
